@prefix : <http://lod.csd.auth.gr/atm/atm.ttl#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:Bank a owl:Class .
:ATM a owl:Class .
:Transaction a owl:Class .

:processesTransaction a owl:ObjectProperty ;
  rdfs:domain :Bank ;
  rdfs:range :Transaction .

:handledBy a owl:ObjectProperty ;
  rdfs:domain :Transaction ;
  rdfs:range :ATM .

# The inverse property of :processesTransaction
:processedBy a owl:ObjectProperty ;
  owl:inverseOf :processesTransaction .
